import React from 'react';


import Header from './components/Header';
import Home  from './pages/Home';
import Footer from './components/Footer';
import NotFound from './pages/NotFound';
import { Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Routes>
        <Header />
        <Home />
        <Footer />
      </Routes>

      </div>
  );
}

export default App;
